export const parseTable = ({table, rowDelimiter, cellDelimiter}) => {
  const data = parseRows({table, delimiter: rowDelimiter})
  .map(row =>
    parseCells({row, delimiter: cellDelimiter})
  );
  return data;
};

export const parseRows = ({table, delimiter}) => table.split(delimiter);

export const parseCells = ({row, delimiter}) => row.split(delimiter);
